import React from 'react';
import s from './Profile.module.css';

const Profile = () => {
    return (
        <div className={s.content}>
            <div>
                <div>
                    <img src='https://ge.faberlicfashion.com/img/promo_parfume.jpg' />
                </div>
                <div>
                    ava + description
                </div>
                </div>
        </div>
    );
}

export default Profile;
